import { useState } from 'react';

const Home = function() {
  return (
    <div>
      <button onClick={window.location.href='/login'}>Login User</button><br/><br/>
      <button onClick={window.location.href='/register'}>Register User</button><br/><br/>
    </div>
  );
};

export default Home;
